import test from 'ava'
import { longestSubstringWithoutRepeatingCharacters } from './'

test(t => {
  const result = longestSubstringWithoutRepeatingCharacters('abcabcbb')
  t.deepEqual(result, 3)
})

test(t => {
  const result = longestSubstringWithoutRepeatingCharacters('bbb')
  t.deepEqual(result, 1)
})

test(t => {
  const result = longestSubstringWithoutRepeatingCharacters('au')
  t.deepEqual(result, 2)
})

test(t => {
  const result = longestSubstringWithoutRepeatingCharacters('b')
  t.deepEqual(result, 1)
})

test(t => {
  const result = longestSubstringWithoutRepeatingCharacters('pwwkew')
  t.deepEqual(result, 3)
})

